data.text:
@xin30465560 Hello
You can see our available tickets via https://t.co/saQXo2wpQa or call our customer service for help https://t.co/b3QIqPk7bj

Best regards /Anna

@GMordaz Hi!

You can find all the numbers we have to the phone by this link https://t.co/b3QIqPk7bj

Kind regards, Kevin

@danpeake Hi!

I recommend you to write in to our customer care department and they will look in if it´s possible to get an reimbursement, you can write to them by this link https://t.co/OzrIxYNv63

Kind regards, Kevin

@MchlBrk Hi! 

I´m sorry for the delay of the respond on Customer care, at the moment there are many people writing so the waiting time is longer, if you haven´t received a response after 6-8 weeks then I recommend you to write in again.

Kind regards, Kevin.

@OPajkos Hi!

We have unfortunately very high que on the phone at the moment, so I recommend you to call in again and you will get through on the phone service.

Kind regards, Kevin

@Steinbakken Hej!

Om det inte går att checka in online så behöver man dessvärre göra det på flygplatsen innan avresa.

Med vänliga hälsningar, Kevin

@onyourownkid Hello!
Yes, pillows and blankets are available on the flight.

Kind regards, Anja

@NiaMoore93 Hello! 
You will find our live chat via our chat bot "Turi" in the lower right corner of this page: https://t.co/b3QIqPk7bj

Kind regards, Anja

@SondraCheek Hi, 
No, this change applies to all ticket types and booking classes.

Regards Anja

@NiclasForsling Jag beklagar men vi följer informationen som finns hos IATA gällande inresereglerna, om du vill lämna synpunkter till oss gällande detta så rekommenderar jag att du använder vårt feedback-formulär https://t.co/OzrIxYvTHt

Med vänlig hälsning,
Anton.

@SuzanneWillett1 No unfortunately not, currently only EU flights to/from Scandinavia and flights within or between Sweden and Denmark.

Best regards,
Anton.

@LEAH__LYONZ Hello! There are many people calling us at the moment so the wait time on our phone support is unfortunately longer than usual. If you have general questions or need help with a simpler case you can try our live-chat instead if you wish https://t.co/b3QIqPBI2R

//
Anton.

@SuzanneWillett1 Hi! At the moment meal service is available for SAS Plus on EU flights to/from Scandinavia or flights over 50 min within/between Sweden and Denmark. Meal service is unfortunately not available for flights in Norway due to restrictions.

Best regards,
Anton.

@OlofVerolin Hej. Just nu är det väldigt många som ringer oss och det orsakar väntetider som är längre än vanligt och vi ber om ursäkt för det.

Med vänlig hälsning,
Anton.

@NiclasForsling Hej! Vi följer informationen som finns hos IATA https://t.co/a90VjPbe7A och det kan ibland hända att vi inte hunnit uppdatera vår hemsida med de senaste inresereglerna. Vi uppdaterar informationen på hemsidan så fort som möjligt.

Med vänlig hälsning,
Anton.

@rstruthe Hello, please contact us via Facebook Messenger or Live-chat https://t.co/b3QIqPk7bj with your booking details for help with information about the status for your voucher.

Best regards,
Anton.

@merepeterson Hello! Please contact us through the Facebook Messenger feature or live-chat https://t.co/b3QIqPk7bj and we will help you take a look at this.

Best regards,
Anton.

@nicholashk Hi Nicholashk

Due to the current COVID-19 situation SAS has decided to temporary limit the allowed amount of carry-on items to 1 per person. This change applies to all ticket types and booking classes.

Kind regards, Christoffer

@Divyesh_Dheeraj Hi, We do not have any student tickets for the moment. We have Youth tickets on our flights that can be booked för passengers that have not yet turned 26 years old https://t.co/Tz1dUIRWRf

Regards,
Peter

@e_extremena Hi, I can not check voucher numbers here on Social media. Please contact us with the voucher number through our Messenger, chat or by phone so that we can check what type of voucher you have and the rules for it.  https://t.co/b3QIqPk7bj

Regards,
Peter

@_kaylarz Due to the covid-19 situation we only allow 1 carry-on item in the cabin, the carry-on must be placed on the floor under the seat in front of you. It is unfortunately not possible to bring any more items to put in the storage above the seats for now.

Best regards,
Anton.

@_kaylarz Hello! The carry-on must be placed on the floor of the cabin under the seat in front of you.

Best regards,
Anton.

@Karlstad I understand, please try again and make sure you are entering details for only one traveler at a time. But if the problem persists you will have to bring the documents to the airport instead.

Best regards,
Anton.

@DrmPharmD You can read more about safe travel with SAS at https://t.co/E6bpHzaWLm

Best regards,
Anton.

@Karlstad Hello. Travel Ready Center is not open for every flight yet, if it is not possible to enter the details via our website you will have to bring the documentation to the airport to show it there instead.

Best regards,
Anton.

@phillidaforsell Please contact us via the Facebook Messenger feature or live-chat with your voucher details and we can help you take a look at that - our live-chat is available on https://t.co/b3QIqPk7bj

Best regards,
Anton.

@CSternschnuppe Hej! Vi beklagar om det inte framgick tydligt att mailet kommer från oss. Det här är den rutinen vi använder för att verifiera betalningsuppgifterna, om du vill lämna feedback till oss gällande det så kan du göra det via https://t.co/wprQ9Zejqh

Med vänlig hälsning,
Anton.

@R0berat Hello! We unfortunately do not use email contact for customer support but you can contact us over live-chat if that is easier for you https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Ninna_Nielsen Hello! We do not require any covid-19 test for the flight itself, as long as you follow the entry rules of Denmark you are allowed to fly with us to there.

Best regards,
Anton.

@hanna_hanna05 Hello! The testing requirements are set by the country you are traveling and this is not something we can affect. If the test does not meet Spain's requirements passengers will be denied boarding. The latest entry restrictions can be found at https://t.co/a90VjPbe7A

//
Anton.

@phillidaforsell Hello! We unfortunately had some problems with voucher payments yesterday but this issue has now been solved and you should be able to book the trip using your voucher.

Best regards,
Anton.

@BaldwinAtBest Hi, you contact the arrival/baggage service at the airport to get status and delivery information on the luggage. The phonen umbers for the airports arrival service can be found on this page https://t.co/ZV9bTO3uo2

Regards,
Peter

@juliabeate After 1st of June,  emotional support dogs can not be added to a booking as a service dog, but they can travel as a ordinary pet in cabin or cargo on our flights. 

Regards,
Peter

@ViviFKristensen Hello! Thank you for your input and feedback. If you wish to leave a complaint to us we recommend that you use our feedback-form https://t.co/wprQ9Zejqh

Best regards,
Anton.

@NicolasNilsen3 Hello, we apologize for the longer than usual wait time on the phone right now. Please contact us via Messenger or live-chat with your voucher details and we will help you take a look at why it did not work for you.

Best regards,
Anton.

@jackedwardberry Hello, we have responded to you on your Facebook comment.

Best regards,
Anton.

@tokjojjen Hello! Our EWR lounge is unfortunately still closed. Only the gold lounges in Stockholm, Oslo and Copenhagen are open for now.

Best regards,
Anton.

@davidpoblador Hello! I am sorry to hear that your voucher had expired. Travel vouchers are valid for 12 months after the day they are issued, please contact us via live-chat or messenger and we can help you take a look at what alternatives there are for your voucher.

Best regards,
Anton.

@oluvj Hi! This extraordinary situation, unfortunately, forces SAS to undertake some unusual measures regarding our customer offerings, including EuroBonus. We apologize for the inconvenience, but given the situation, we are not able to extend Eurobonus points.

Best Regards,
Anton

@JrgenMoe Hej. Vi beklagar över den långa väntetiden på telefon just nu. Det är väldigt många som kontaktar oss och det orsakar ovanligt långa köer.

Med vänlig hälsning,
Anton.

@IvarStokkereit Hej, vi beklagar att ert flyg blev inställt. Vid inställt flyg får man hjälp med ombokning till ett nytt flyg, antingen på flygplatsen eller genom att kontakta oss på telefon.

Med vänlig hälsning,
Anton.

@spooneybooney Hello, I hope this was solved over the Messenger chat. If not please contact us on Messenger again and we can help you there.

Best regards,
Anton.

@califshirleyb Hi Califshirleyb, Please contact our Customer Service at the following link or at Facebook Messenger and we will help you further in your errand,
https://t.co/b3QIqPk7bj

Kind regards, Isak

@msAnnaChristina Hej Anna, 
För närvarande är guldloungen på Arlanda öppen. Våra lounger öppnar ungefär 60 minuter före dagens första SAS-avgång och stänger ungefär 30 minuter före den sista. Du kan läsa mer om tillgången till lounge här: https://t.co/63gRjhqYUS
Hälsningar Anja

@tobiashelmer Hej! Ni behöver se till att ni följer de restriktioner som finns vid er transfer i Danmark och inresa i Sverige och hittar den information vi har tillgänglig här: https://t.co/88upd1j4u2 
Kontakta gärna myndigheterna i länderna för fler svar. 
/Vänliga hälsningar, Rebecka

@magdagarciax Hej Magdagarciax!

Du bokar resan och sedan kontaktar du oss via chatt eller telefon för att registrera det i din bokning. Via denna länk kan du hitta information om resor med djur:
https://t.co/TgSjZJD6je

@bigmaxen Hej! I nuläget finns det inga krav på negativt covid-19 test för att resa inrikes. Så länge du är fri från förkylningssymptom och använder munskydd under flygningen så kan du flyga med oss inrikes.

Med vänlig hälsning,
Anton.

@tinor98 Hello, I'm sorry to hear that you're having problems with your Bodø to Stavanger flight. We apologize for the longer than usual queue times at the moment but rebooking can only be made over the phone with us.

Best regards,
Anton.

@FabianTapl Hello Fabian,
You can call our German support on +49 6986 799 676, https://t.co/b3QIqPk7bj
Thank you for contacting us, regards Anja

@mahemama Hej! 

Ja det är ingen fara, vi utgår ifrån landets regler, så det ska inte vara något problem. 

//Vänlig hälsning, Dennis.

@mahemama @SAS_Press Hej! 

Vi uppdaterar informationen så fort vi får in det officiellt. Men vi rekommenderar alltid att resenärerna kollar vilka regler som gäller med landets ambassad.

//Vänlig hälsning, Dennis.

@krtexxx Hello, I am sorry that you feel that way about us as an airline. If you wish to leave a complaint about your experience flying with us please use our feedback-form https://t.co/wprQ9Zejqh

Best regards,
Anton.

@MiiguelCastilla Okej, då behöver ni avvakta lite till och försöka ladda ner boardingpassen senare. ADOC läggs till automatiskt efter att dokumenten är godkända.

Med vänlig hälsning,
Anton.

@MiiguelCastilla Hej! När era uppladdade dokument är godkända kommer check-in online att öppna och ni kommer då efter incheckning online att få det digitala boardingpasset.

Med vänlig hälsning,
Anton.
